import React from "react";


const showinfo = ({name,image,genres,language,rating,summary}) => {
    return(
        <div>
            <h1>{name}</h1>
            <img src={image}></img>
            <p>{summary}</p>
            <p>{language}</p>
            <p>{genres}</p>
        </div>
    )
}
export default showinfo;
